@testset "1.2.2.5 P(x) (a+b x^2+c x^4)^p" begin
    (a, b, c, d, e, f, g, h, i, j, k, l, m, x, ) = @variables a b c d e f g h i j k l m x

    #= ::Package:: =#

    #= ::Section:: =#
    #=Integrands*of*the*form*Poly(x)*(a+b*x^2+c*x^4)^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*Poly(x)*(a+b*x^2+c*x^4)^p=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(d + e*x)*(a + b*x^2 + c*x^4), x, 2, a*d*x + (1/2)*a*e*x^2 + (1/3)*b*d*x^3 + (1/4)*b*e*x^4 + (1/5)*c*d*x^5 + (1/6)*c*e*x^6]
    @test_int [(d + e*x + f*x^2)*(a + b*x^2 + c*x^4), x, 2, a*d*x + (1/2)*a*e*x^2 + (1/3)*(b*d + a*f)*x^3 + (1/4)*b*e*x^4 + (1/5)*(c*d + b*f)*x^5 + (1/6)*c*e*x^6 + (1/7)*c*f*x^7]
    @test_int [(d + e*x + f*x^2 + g*x^3)*(a + b*x^2 + c*x^4), x, 2, a*d*x + (1/2)*a*e*x^2 + (1/3)*(b*d + a*f)*x^3 + (1/4)*(b*e + a*g)*x^4 + (1/5)*(c*d + b*f)*x^5 + (1/6)*(c*e + b*g)*x^6 + (1/7)*c*f*x^7 + (1/8)*c*g*x^8]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4)*(a + b*x^2 + c*x^4), x, 2, a*d*x + (1/2)*a*e*x^2 + (1/3)*(b*d + a*f)*x^3 + (1/4)*(b*e + a*g)*x^4 + (1/5)*(c*d + b*f + a*h)*x^5 + (1/6)*(c*e + b*g)*x^6 + (1/7)*(c*f + b*h)*x^7 + (1/8)*c*g*x^8 + (1/9)*c*h*x^9]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4 + i*x^5)*(a + b*x^2 + c*x^4), x, 2, a*d*x + (1/2)*a*e*x^2 + (1/3)*(b*d + a*f)*x^3 + (1/4)*(b*e + a*g)*x^4 + (1/5)*(c*d + b*f + a*h)*x^5 + (1/6)*(c*e + b*g + a*i)*x^6 + (1/7)*(c*f + b*h)*x^7 + (1/8)*(c*g + b*i)*x^8 + (1/9)*c*h*x^9 + (1/10)*c*i*x^10]


    @test_int [(d + e*x)*(a + b*x^2 + c*x^4)^2, x, 2, a^2*d*x + (1/2)*a^2*e*x^2 + (2/3)*a*b*d*x^3 + (1/2)*a*b*e*x^4 + (1/5)*(b^2 + 2*a*c)*d*x^5 + (1/6)*(b^2 + 2*a*c)*e*x^6 + (2/7)*b*c*d*x^7 + (1/4)*b*c*e*x^8 + (1/9)*c^2*d*x^9 + (1/10)*c^2*e*x^10]
    @test_int [(d + e*x + f*x^2)*(a + b*x^2 + c*x^4)^2, x, 2, a^2*d*x + (1/2)*a^2*e*x^2 + (1/3)*a*(2*b*d + a*f)*x^3 + (1/2)*a*b*e*x^4 + (1/5)*(b^2*d + 2*a*c*d + 2*a*b*f)*x^5 + (1/6)*(b^2 + 2*a*c)*e*x^6 + (1/7)*(2*b*c*d + b^2*f + 2*a*c*f)*x^7 + (1/4)*b*c*e*x^8 + (1/9)*c*(c*d + 2*b*f)*x^9 + (1/10)*c^2*e*x^10 + (1/11)*c^2*f*x^11]
    @test_int [(d + e*x + f*x^2 + g*x^3)*(a + b*x^2 + c*x^4)^2, x, 2, a^2*d*x + (1/2)*a^2*e*x^2 + (1/3)*a*(2*b*d + a*f)*x^3 + (1/4)*a*(2*b*e + a*g)*x^4 + (1/5)*(b^2*d + 2*a*c*d + 2*a*b*f)*x^5 + (1/6)*(b^2*e + 2*a*c*e + 2*a*b*g)*x^6 + (1/7)*(2*b*c*d + b^2*f + 2*a*c*f)*x^7 + (1/8)*(2*b*c*e + b^2*g + 2*a*c*g)*x^8 + (1/9)*c*(c*d + 2*b*f)*x^9 + (1/10)*c*(c*e + 2*b*g)*x^10 + (1/11)*c^2*f*x^11 + (1/12)*c^2*g*x^12]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4)*(a + b*x^2 + c*x^4)^2, x, 2, a^2*d*x + (1/2)*a^2*e*x^2 + (1/3)*a*(2*b*d + a*f)*x^3 + (1/4)*a*(2*b*e + a*g)*x^4 + (1/5)*(b^2*d + 2*a*b*f + a*(2*c*d + a*h))*x^5 + (1/6)*(b^2*e + 2*a*c*e + 2*a*b*g)*x^6 + (1/7)*(b^2*f + 2*a*c*f + 2*b*(c*d + a*h))*x^7 + (1/8)*(2*b*c*e + b^2*g + 2*a*c*g)*x^8 + (1/9)*(c^2*d + b^2*h + 2*c*(b*f + a*h))*x^9 + (1/10)*c*(c*e + 2*b*g)*x^10 + (1/11)*c*(c*f + 2*b*h)*x^11 + (1/12)*c^2*g*x^12 + (1/13)*c^2*h*x^13]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [(d + e*x)/(4 - 5*x^2 + x^4), x, 10, (-(1/6))*d*atanh(x/2) + (1/3)*d*atanh(x) - (1/6)*e*log(1 - x^2) + (1/6)*e*log(4 - x^2)]
    @test_int [(d + e*x + f*x^2)/(4 - 5*x^2 + x^4), x, 9, (-(1/6))*(d + 4*f)*atanh(x/2) + (1/3)*(d + f)*atanh(x) - (1/6)*e*log(1 - x^2) + (1/6)*e*log(4 - x^2)]
    @test_int [(d + e*x + f*x^2 + g*x^3)/(4 - 5*x^2 + x^4), x, 8, (-(1/6))*(d + 4*f)*atanh(x/2) + (1/3)*(d + f)*atanh(x) - (1/6)*(e + g)*log(1 - x^2) + (1/6)*(e + 4*g)*log(4 - x^2)]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4)/(4 - 5*x^2 + x^4), x, 10, h*x - (1/6)*(d + 4*f + 16*h)*atanh(x/2) + (1/3)*(d + f + h)*atanh(x) - (1/6)*(e + g)*log(1 - x^2) + (1/6)*(e + 4*g)*log(4 - x^2)]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4 + i*x^5)/(4 - 5*x^2 + x^4), x, 12, h*x + (i*x^2)/2 - (1/6)*(d + 4*f + 16*h)*atanh(x/2) + (1/3)*(d + f + h)*atanh(x) - (1/6)*(e + g + i)*log(1 - x^2) + (1/6)*(e + 4*g + 16*i)*log(4 - x^2)]

    @test_int [(d + e*x)/(1 + x^2 + x^4), x, 15, -((d*atan((1 - 2*x)/sqrt(3)))/(2*sqrt(3))) + (d*atan((1 + 2*x)/sqrt(3)))/(2*sqrt(3)) + (e*atan((1 + 2*x^2)/sqrt(3)))/sqrt(3) - (1/4)*d*log(1 - x + x^2) + (1/4)*d*log(1 + x + x^2)]
    @test_int [(d + e*x + f*x^2)/(1 + x^2 + x^4), x, 14, -(((d + f)*atan((1 - 2*x)/sqrt(3)))/(2*sqrt(3))) + ((d + f)*atan((1 + 2*x)/sqrt(3)))/(2*sqrt(3)) + (e*atan((1 + 2*x^2)/sqrt(3)))/sqrt(3) - (1/4)*(d - f)*log(1 - x + x^2) + (1/4)*(d - f)*log(1 + x + x^2)]
    @test_int [(d + e*x + f*x^2 + g*x^3)/(1 + x^2 + x^4), x, 15, -(((d + f)*atan((1 - 2*x)/sqrt(3)))/(2*sqrt(3))) + ((d + f)*atan((1 + 2*x)/sqrt(3)))/(2*sqrt(3)) + ((2*e - g)*atan((1 + 2*x^2)/sqrt(3)))/(2*sqrt(3)) - (1/4)*(d - f)*log(1 - x + x^2) + (1/4)*(d - f)*log(1 + x + x^2) + (1/4)*g*log(1 + x^2 + x^4)]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4)/(1 + x^2 + x^4), x, 17, h*x - ((d + f - 2*h)*atan((1 - 2*x)/sqrt(3)))/(2*sqrt(3)) + ((d + f - 2*h)*atan((1 + 2*x)/sqrt(3)))/(2*sqrt(3)) + ((2*e - g)*atan((1 + 2*x^2)/sqrt(3)))/(2*sqrt(3)) - (1/4)*(d - f)*log(1 - x + x^2) + (1/4)*(d - f)*log(1 + x + x^2) + (1/4)*g*log(1 + x^2 + x^4)]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4 + i*x^5)/(1 + x^2 + x^4), x, 19, h*x + (i*x^2)/2 - ((d + f - 2*h)*atan((1 - 2*x)/sqrt(3)))/(2*sqrt(3)) + ((d + f - 2*h)*atan((1 + 2*x)/sqrt(3)))/(2*sqrt(3)) + ((2*e - g - i)*atan((1 + 2*x^2)/sqrt(3)))/(2*sqrt(3)) - (1/4)*(d - f)*log(1 - x + x^2) + (1/4)*(d - f)*log(1 + x + x^2) + (1/4)*(g - i)*log(1 + x^2 + x^4)]

    @test_int [(d + e*x)/(a + b*x^2 + c*x^4), x, 9, (sqrt(2)*sqrt(c)*d*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(b^2 - 4*a*c)*sqrt(b - sqrt(b^2 - 4*a*c))) - (sqrt(2)*sqrt(c)*d*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(b^2 - 4*a*c)*sqrt(b + sqrt(b^2 - 4*a*c))) - (e*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/sqrt(b^2 - 4*a*c)]
    @test_int [(d + e*x + f*x^2)/(a + b*x^2 + c*x^4), x, 8, ((f + (2*c*d - b*f)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*sqrt(c)*sqrt(b - sqrt(b^2 - 4*a*c))) + ((f - (2*c*d - b*f)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*sqrt(c)*sqrt(b + sqrt(b^2 - 4*a*c))) - (e*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/sqrt(b^2 - 4*a*c)]
    @test_int [(d + e*x + f*x^2 + g*x^3)/(a + b*x^2 + c*x^4), x, 9, ((f + (2*c*d - b*f)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*sqrt(c)*sqrt(b - sqrt(b^2 - 4*a*c))) + ((f - (2*c*d - b*f)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*sqrt(c)*sqrt(b + sqrt(b^2 - 4*a*c))) - ((2*c*e - b*g)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*c*sqrt(b^2 - 4*a*c)) + (g*log(a + b*x^2 + c*x^4))/(4*c)]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4)/(a + b*x^2 + c*x^4), x, 11, (h*x)/c + ((c*f - b*h + (2*c^2*d + b^2*h - c*(b*f + 2*a*h))/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(3/2)*sqrt(b - sqrt(b^2 - 4*a*c))) + ((c*f - b*h - (2*c^2*d - b*c*f + b^2*h - 2*a*c*h)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(3/2)*sqrt(b + sqrt(b^2 - 4*a*c))) - ((2*c*e - b*g)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*c*sqrt(b^2 - 4*a*c)) + (g*log(a + b*x^2 + c*x^4))/(4*c)]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4 + i*x^5)/(a + b*x^2 + c*x^4), x, 13, (h*x)/c + (i*x^2)/(2*c) + ((c*f - b*h + (2*c^2*d + b^2*h - c*(b*f + 2*a*h))/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(3/2)*sqrt(b - sqrt(b^2 - 4*a*c))) + ((c*f - b*h - (2*c^2*d - b*c*f + b^2*h - 2*a*c*h)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(3/2)*sqrt(b + sqrt(b^2 - 4*a*c))) - ((2*c^2*e - b*c*g + b^2*i - 2*a*c*i)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*c^2*sqrt(b^2 - 4*a*c)) + ((c*g - b*i)*log(a + b*x^2 + c*x^4))/(4*c^2)]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4 + j*x^5 + k*x^6 + l*x^7 + m*x^8)/(a + b*x^2 + c*x^4), x, 13, ((c^2*h + b^2*m - c*(b*k + a*m))*x)/c^3 + ((c*j - b*l)*x^2)/(2*c^2) + ((c*k - b*m)*x^3)/(3*c^2) + (l*x^4)/(4*c) + (m*x^5)/(5*c) + ((c^3*f - c^2*(b*h + a*k) - b^3*m + b*c*(b*k + 2*a*m) + (2*c^4*d - c^3*(b*f + 2*a*h) + b^4*m - b^2*c*(b*k + 4*a*m) + c^2*(b^2*h + 3*a*b*k + 2*a^2*m))/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(7/2)*sqrt(b - sqrt(b^2 - 4*a*c))) + ((c^3*f - c^2*(b*h + a*k) - b^3*m + b*c*(b*k + 2*a*m) - (2*c^4*d - c^3*(b*f + 2*a*h) + b^4*m - b^2*c*(b*k + 4*a*m) + c^2*(b^2*h + 3*a*b*k + 2*a^2*m))/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(7/2)*sqrt(b + sqrt(b^2 - 4*a*c))) - ((2*c^3*e - c^2*(b*g + 2*a*j) - b^3*l + b*c*(b*j + 3*a*l))*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*c^3*sqrt(b^2 - 4*a*c)) + ((c^2*g + b^2*l - c*(b*j + a*l))*log(a + b*x^2 + c*x^4))/(4*c^3)]


    @test_int [(d + e*x)/(4 - 5*x^2 + x^4)^2, x, 12, (d*x*(17 - 5*x^2))/(72*(4 - 5*x^2 + x^4)) + (e*(5 - 2*x^2))/(18*(4 - 5*x^2 + x^4)) + (19/432)*d*atanh(x/2) - (1/54)*d*atanh(x) + (1/27)*e*log(1 - x^2) - (1/27)*e*log(4 - x^2)]
    @test_int [(d + e*x + f*x^2)/(4 - 5*x^2 + x^4)^2, x, 11, (e*(5 - 2*x^2))/(18*(4 - 5*x^2 + x^4)) + (x*(17*d + 20*f - (5*d + 8*f)*x^2))/(72*(4 - 5*x^2 + x^4)) + (1/432)*(19*d + 52*f)*atanh(x/2) - (1/54)*(d + 7*f)*atanh(x) + (1/27)*e*log(1 - x^2) - (1/27)*e*log(4 - x^2)]
    @test_int [(d + e*x + f*x^2 + g*x^3)/(4 - 5*x^2 + x^4)^2, x, 10, (x*(17*d + 20*f - (5*d + 8*f)*x^2))/(72*(4 - 5*x^2 + x^4)) + (5*e + 8*g - (2*e + 5*g)*x^2)/(18*(4 - 5*x^2 + x^4)) + (1/432)*(19*d + 52*f)*atanh(x/2) - (1/54)*(d + 7*f)*atanh(x) + (1/54)*(2*e + 5*g)*log(1 - x^2) - (1/54)*(2*e + 5*g)*log(4 - x^2)]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4)/(4 - 5*x^2 + x^4)^2, x, 10, (5*e + 8*g - (2*e + 5*g)*x^2)/(18*(4 - 5*x^2 + x^4)) + (x*(17*d + 20*f + 32*h - (5*d + 8*f + 20*h)*x^2))/(72*(4 - 5*x^2 + x^4)) + (1/432)*(19*d + 52*f + 112*h)*atanh(x/2) - (1/54)*(d + 7*f + 13*h)*atanh(x) + (1/54)*(2*e + 5*g)*log(1 - x^2) - (1/54)*(2*e + 5*g)*log(4 - x^2)]
    @test_int [(d + e*x + f*x^2 + g*x^3 + h*x^4 + i*x^5)/(4 - 5*x^2 + x^4)^2, x, 11, (x*(17*d + 20*f + 32*h - (5*d + 8*f + 20*h)*x^2))/(72*(4 - 5*x^2 + x^4)) + (5*e + 8*g + 20*i - (2*e + 5*g + 17*i)*x^2)/(18*(4 - 5*x^2 + x^4)) + (1/432)*(19*d + 52*f + 112*h)*atanh(x/2) - (1/54)*(d + 7*f + 13*h)*atanh(x) + (1/54)*(2*e + 5*g + 8*i)*log(1 - x^2) - (1/54)*(2*e + 5*g + 8*i)*log(4 - x^2)]

    @test_int [(d + e*x)/(1 + x^2 + x^4)^2, x, 17, (d*x*(1 - x^2))/(6*(1 + x^2 + x^4)) + (e*(1 + 2*x^2))/(6*(1 + x^2 + x^4)) - (d*atan((1 - 2*x)/sqrt(3)))/(3*sqrt(3)) + (d*atan((1 + 2*x)/sqrt(3)))/(3*sqrt(3)) + (2*e*atan((1 + 2*x^2)/sqrt(3)))/(3*sqrt(3)) - (1/4)*d*log(1 - x + x^2) + (1/4)*d*log(1 + x + x^2)]
    @test_int [(d + e*x + f*x^2)/(1 + x^2 + x^4)^2, x, 16, (e*(1 + 2*x^2))/(6*(1 + x^2 + x^4)) + (x*(d + f - (d - 2*f)*x^2))/(6*(1 + x^2 + x^4)) - ((4*d + f)*atan((1 - 2*x)/sqrt(3)))/(12*sqrt(3)) + ((4*d + f)*atan((1 + 2*x)/sqrt(3)))/(12*sqrt(3)) + (2*e*atan((1 + 2*x^2)/sqrt(3)))/(3*sqrt(3)) - (1/8)*(2*d - f)*log(1 - x + x^2) + (1/8)*(2*d - f)*log(1 + x + x^2)]
    @test_int [(d + e*x + f*x^2 + g*x^3)/(1 + x^2 + x^4)^2, x, 15, (x*(d + f - (d - 2*f)*x^2))/(6*(1 + x^2 + x^4)) + (e - 2*g + (2*e - g)*x^2)/(6*(1 + x^2 + x^4)) - ((4*d + f)*atan((1 - 2*x)/sqrt(3)))/(12*sqrt(3)) + ((4*d + f)*atan((1 + 2*x)/sqrt(3)))/(12*sqrt(3)) + ((2*e - g)*atan((1 + 2*x^2)/sqrt(3)))/(3*sqrt(3)) - (1/8)*(2*d - f)*log(1 - x + x^2) + (1/8)*(2*d - f)*log(1 + x + x^2)]
